/*!50003 DROP PROCEDURE IF EXISTS `Products_Create` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'NO_AUTO_VALUE_ON_ZERO' */ ;
DELIMITER ;;
CREATE  PROCEDURE `Products_Create`(IN `_code` CHAR(8), IN `_description` TEXT, IN `_color` CHAR(6), IN `_price` FLOAT, IN `_category` VARCHAR(16), IN `_rating` DOUBLE, IN `_refurbished` TINYINT(1), IN `_manufactureYear` YEAR)
BEGIN

INSERT INTO products (product_code, description, color, price, category, rating, refurbished, manufacture_year)
VALUES (_code, _description, _color, _price, _category, _rating, _refurbished, _manufactureYear);

SELECT @@identity AS id;

END ;;
DELIMITER ;
