/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = '' */ ;
DELIMITER ;;
CREATE  PROCEDURE `Products_FindAvgPriceByCategory`(IN _category VARCHAR(16))
BEGIN

SELECT AVG(price)
FROM products WHERE category = _category;

END ;;
